import "./Search.scss";

function Search() {
  return (
    <div className="search">
      <div className="search_item">
          <img className="search_img" src="https://img.ophim.tv/uploads/movies/qua-nhanh-qua-nguy-hiem-6-thumb.jpg" alt="hinh anh" />
          <p className="search_name"></p>
      </div>
    </div>
  );
}

export default Search;
